import { ReactNode } from "react";

interface Props {
  children: ReactNode;
}

const Alert = ({ children }: Props) => {
  return (
    <div className="alert alert-primary alert-dismissible">{children}
    <button type="button" class="btn"></button>
    </div>
  );
};

export default Alert;
